// ---------- imports ----------
import '../styles/Footer.css';

import WhatsAppLogo  from '../assets/whatsapp-logo.png';
import GmailLogo     from '../assets/gmail-logo.png';
import InstagramLogo from '../assets/instagram-logo.png';
import YouTubeLogo   from '../assets/youtube-logo.png';
import FacebookLogo  from '../assets/facebook-logo.png';
import TwitterLogo   from '../assets/twitter-logo.png';
import ThreadsLogo   from '../assets/threads-logo.png';

// ---------- constants ----------
const FOUNDER_DETAILS_URL = 'https://comeonsom.github.io/Big-Pocket.com/Other-files/founder.html';
const TERMS_PAGE_URL      = 'https://comeonsom.github.io/Big-Pocket.com/Other-files/terms.html';

const Footer = () => {
  /* ----- CTA handlers ----- */
  const handleWhatsAppClick = () =>
    window.open('https://wa.me/917866049865', '_blank');

  const handleEmailClick = () =>
    window.open(
      'https://mail.google.com/mail/?view=cm&fs=1&to=asversity.helpdesk@gmail.com',
      '_blank'
    );

  /* ---------- render ---------- */
  return (
    <>
      {/* ---- Contact section ---- */}
      <div className="contact-container">
        <div className="contact-section">
          <h2>Contact Us</h2>
          <p>If you have any questions, feel free to reach out to us!</p>

          <div className="button-container">
            <button onClick={handleWhatsAppClick} className="contact-whatsapp-button">
              <img src={WhatsAppLogo} alt="WhatsApp" className="button-icon" />
              Send Message
            </button>

            <button onClick={handleEmailClick} className="contact-email-button">
              <img src={GmailLogo} alt="Gmail" className="button-icon" />
              Send Email
            </button>
          </div>
        </div>

        {/* ---- Social section ---- */}
        <div className="follow-us-section">
          <h3 className="follow-us-heading">Follow Us</h3>
          <div className="social-icons">
            <a href="https://www.instagram.com/asversity.insta/profilecard/?igsh=bXNiNGFjcXFwcnVq"   target="_blank" rel="noopener noreferrer">
              <img src={InstagramLogo} alt="Instagram" />
            </a>
            <a href="https://youtube.com/@asversity_technologies?si=cGzrBWY0-kSOzmdP"               target="_blank" rel="noopener noreferrer">
              <img src={YouTubeLogo} alt="YouTube" />
            </a>
            <a href="https://www.facebook.com/asversityfacebook?mibextid=ZbWKwL"                     target="_blank" rel="noopener noreferrer">
              <img src={FacebookLogo} alt="Facebook" />
            </a>
            <a href="https://x.com/Tcepsus_Vom?t=wbzoSwBzlryCJUYXVq9Eaw&s=09"                        target="_blank" rel="noopener noreferrer">
              <img src={TwitterLogo} alt="Twitter / X" />
            </a>
            <a href="https://www.threads.net/@asversity.insta?invite=0"                              target="_blank" rel="noopener noreferrer">
              <img src={ThreadsLogo} alt="Threads" />
            </a>
          </div>
        </div>
      </div>

      {/* ---- Footer ---- */}
      <footer className="footer">
        <p>Â© {new Date().getFullYear()} ASCORP. All rights reserved.</p>
        <p>
          <span
            className="clickable-text"
            onClick={() => window.open(FOUNDER_DETAILS_URL, '_blank')}
          >
            Founder Details
          </span>
          {' | '}
          <span
            className="clickable-text"
            onClick={() => window.open(TERMS_PAGE_URL, '_blank')}
          >
            Terms of Service
          </span>
        </p>
      </footer>
    </>
  );
};

export default Footer;
